import {useReducer} from 'react';
import {Routes, Route} from 'react-router-dom'
import './components/index.js';
import {Header, Home, Footer, Login, Register, 
        PageNotFound, AppContext, reducer, actionpayloads
} from './exportStore';

function App() {
  const [state, dispatch] = useReducer(reducer, actionpayloads.initialState);

  return (
    <AppContext.Provider value={{state, dispatch}}>
      <div className="app">
        <Header/>
        <Routes>
          <Route path="/" element={<Home/>}/>
          <Route path="/login" element={<Login/>}/>
          <Route path="/register" element={<Register/>}/>
          <Route path="*" element={<PageNotFound/>}/>
        </Routes>
        <Footer/>
      </div>
    </AppContext.Provider>
  );
}

export default App;
